import axios from "axios";


const API_URL = "http://localhost:8082/api/sowing";


export const getAllSowings = () => axios.get(API_URL);
export const registerSowing = (data) => axios.post(API_URL, data);
export const updateSowing = (id, data) => axios.put(`${API_URL}/${id}`, data);
export const deleteSowing = (id) => axios.delete(`${API_URL}/${id}`);
